import React from 'react';
import axios from 'axios';

class Timeslot extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            numberOfKills: null,
            shipSelected: 'Naglfar'
        };
    }
    componentDidMount = () => {
        axios.get(`/api/esi/${this.props.name}/${this.state.shipSelected}/${this.props.time}`)
            .then(response => {
                return this.setState({numberOfKills: response.data.parsedData})
            })
    };
    render(){
            return (
                <li>{this.state.numberOfKills}</li>
            )
    }
};

export default Timeslot;
